export type IconsType = keyof typeof icons;

interface IProps extends React.HTMLAttributes<HTMLDivElement> {
  icon: IconsType | string;
}

export const defaultIcon = "dataTables";

export function haveIcon(icon: string) {
  return Object.keys(icons).includes(icon);
}

export default function Icons({ icon, ...props }: IProps) {
  return (
    <div {...props}>
      {haveIcon(icon) ? icons[icon as IconsType] : icons["close"]}
    </div>
  );
}
